import React, { Component } from 'react';

class HomeBucketOneContainer extends Component {
  render() {
    return (
      <div id="homepage-bucketone-container">
        <div className="blog-box">
          <div className="blog-title">
            <h4>Blog Title</h4>

          </div>
        </div>
      </div>
    )
  }
}

export default HomeBucketOneContainer;
